I spent the last hour shining my boots and they look so, well...shiny. Yay me. Anywho, seeing as how Christmas is just around the corner, I will post my favorite Christmas song:

<H1><H1 class=Text>Bon Jovi - Bells Will Be Ringing Lyrics</H1></H1><SCRIPT type=text/javascript><!--google_ad_client = "pub-0137437120037312";google_alternate_ad_url = "http://www.smartlyrics.com/widead.html";google_ad_width = 336;google_ad_height = 280;google_ad_format = "336x280_as";google_ad_channel ="0331720601";google_ad_type = "text_image";google_color_border = "DFE6ED";google_color_bg = "DFE6ED";google_color_link = "FF9A00";google_color_url = "072C52";google_color_text = "072C52";//--></SCRIPT><SCRIPT src="http://pagead2.googlesyndication.com/pagead/show_ads.js" type=text/javascript></SCRIPT>

<CENTER>Bells will be ringing, the glad, glad news;
Oh, what a Christmas, to have the blues;
My baby's gone;
I have no friends;
To wish me greetings, once again;
Choirs will be singing, Silent Night
Oh, Christmas Carols, by candlelight;

Please come home for Christmas;
Please come home for Christmas;
If not for Christmas, by New Year's Night;

Friends and relations;
Send salutations;
Just as sure as the stars shine above;
This is Christmas, Christmas my dear;
The time of year to be with the one that you love;

Then will you tell me, you'll never more roam;
Christmas and New Year will find you home;
There'll be no more sorrow;
No grief or pain;
'Cause I'll be happy that it's Christmas once again.</CENTER>
